import seminar from './src/images/dt.jpg';
import wed from './src/images/wed.webp';
import birthd from './src/images/birthd.jpg';

const S2data = [
    {
        imgsrc: seminar,
        title: 'Wedding Planners',
    },
    {
        imgsrc: wed,
        title: 'Seminar',
    },
    {
        imgsrc: birthd,
        title: 'Birthday Party',
    },
];
export default S2data;
